INSERT INTO `about` VALUES (2,'KSE','Aplikasi ini digunakan untuk sekolah yang menggunakan  sistem Kantin Sekolah Elektronik (KSE), \r\nGenerasi yang SEHAT berawal dari MAKANAN (JAJANAN) yang SEHAT.\r\nKantin sekolah elektronik adalah sistem transaksi pembelian barang di kanton mmaupun koperasi sekolah dengan NON TUNAI, jadi siswa mempunyai saldo (akun) yang bisa digunakan untuk melakukan transaksi. Baik dengan id card ataupun dengan scan barcode. Bahkan bisa dikembangkan dengan sistem order, jadi siswa bisa melakukan pemesanan makanan sebelum wak'),(5,'PEMBAYARAN','Aplikasi ini ditujukan untuk sekolah yang mempunyai aplikasi pembayaran siswa, baik SPP, uang gedung, seragam, buku, dll. Dimana walimurdi dapat mengetahui history pembayaran anaknya, sehingga mengetahui tagihan yang belum dibayarkan, dan juga untuk mengetahui jika terjadi masalah dengan anaknya yakni uang pembayaran tidak dibayarkan ke sekolah.\r\nAplikasi ini juga akan otomatis memberi notifikasi pembayaran Ketika bagian keuangan menginputkan data pembayaran yang dibayarkan oleh siswa. '),(6,'PELANGGARAN','Aplikasi ini ditujukan untuk mengetahui poin dan macam pelanggaran siswa oleh walimurid. \r\nAplikasi ini akan memberikan notifikasi ke walimurid ketika guru BK menginput data pelanggaran siswa.'),(7,'KONSELING','Aplikasi ini digunakan untuk bimbingan konseling dengan guru BK di sekolah. Siswa akan mengirimkan topik / kategori konseling, yang nantinya akan di balas oleh pihak BK.'),(8,'JURNAL','Aplikasi ini untuk melihat jurnal kelas harian, guru mata paleajaran yang hadir dikelas akan mengisi jurnal kelas melalui aplikasi, dan siswa / walimurid dapat mengetahui jadwal, mata pelajaran serta materi dan juga uraian kegiatan pembelajaran di kelas dengan syarat telah diinput oleh guru.'),(9,'TANYA GURU','Aplikasi ini digunakan untuk melakukan percakapan secara privat dengan guru yang dituju.'),(10,'IZIN','Aplikasi ini digunakan untuk mengirimkan izin ke sekolah beserta upload gambar surat izin, dimana pihak sekolah akan melakukan validasi dan wlaimurid mendapat info notif jika izin sudah di validasi.'),(11,'AKADEMIK','Aplikasi ini berisi kumpulan file atau dokumen yang bersifat umum. Dimana siswa atau walimurid dapat men-download data yang dinginkan. Data bisa berupa kalender akademik, kumpulan soal, bahan ajar dll.'),(12,'ABSEN\r\n','Aplikasi absen digunakan oleh guru kelas melakukan input absensi harian siswa di kelas tersebut, dan siswa yang di absen, baik masuk, izin, alpha, pemberitahuan (notifikasi) akan tersebar ke aplikasi di walimurid / siswa secara otomatis.\r\nUntuk sekolah yang menggunakan mesin absen (finger print) maka akan ada pemberitahuan tentang jam kehadiran siswa yang diambil dari mesin absen, namun jika siswa tidak melakukan absen di mesin, maka akan ada info pemeritahuan TIDAK ABSEN.\r\nJadi ada tiga status kehadiran si'),(13,'INFORMASI','Aplikasi ini digunakan untuk menyebarkan informasi sekolah ke walimurid maupun siswa, informasi bisa berupa gambar.'),(14,'OVERVIEW','VERSI Beta (Uji Coba)\r\nAplikasi ini bertujuan untuk meningkatkan nilai (value) suatu lembaga pendidikan di era digital saat ini, dimana semua dituntut agar mampu memberikan layanan informasi yang cepat, akurat dan mudah diakses dengan teknologi saat ini.\r\nAplikasi ini masih dalam tahap pengembangan (trial) jadi jika terdapat kesalahan atau error, mohon kerjasamanya agar dapat meningkatkan kualitas aplikasi ini.\r\nTerimakasih.');
